import {combineReducers} from '@reduxjs/toolkit';
import {createStore} from 'redux'
import { userRedusers, usersReducers } from './reducer';


const users = [
  {
    id: 'sdfsdf',
    name: 'Ivan',
    surname: 'Ivanov',
    e_mail: 'IvanIvanov@mail.ru'
  }
]

const rootReducers = combineReducers({userRedusers, usersReducers})



export const store = createStore(
  rootReducers,
)

store.dispatch({
  type: 'ADD_USER',
  payload: {
    id: '323uytgfs5',
    name: 'Kirill',
    surname: 'Kostyu',
    e_mail: 'kostyukirill@yandex.ru'
  }
})

console.log(store.getState().userRedusers)
